import java.util.HashSet;
import java.util.Set;

//哦，不！你不小心把一个长篇文章中的空格、标点都删掉了，并且大写也弄成了小写。
//像句子"I reset the computer. It still didn’t boot!"已经变成了"iresetthecomputeritstilldidntboot"。
//在处理标点符号和大小写之前，你得先把它断成词语。当然了，你有一本厚厚的词典dictionary，不过，有些词没在词典里。
//假设文章用sentence表示，设计一个算法，把文章断开，要求未识别的字符最少，返回未识别的字符数。
//
//注意：本题相对原题稍作改动，只需返回未识别的字符数

//使用动态规划，dp[i]表示前i个字符里未识别的最少字符数，则dp[i]=min(dp[i-1]+1,(dp[j]|dict.contains(sentence.substring(j+1,i+1))
class respace {
    public int main(String[] dictionary, String sentence) {
        if(sentence.length()==0)
            return 0;
        Set<String> dict=new HashSet<>();
        for(String s:dictionary)
            dict.add(s);
        int[] dp=new int[sentence.length()];
        dp[0]=dict.contains(sentence.substring(0,1))?0:1;
        for(int i=1;i<sentence.length();i++){
            dp[i]=dp[i-1]+1;
            for(int j=0;j<=i;j++){
                if(dict.contains(sentence.substring(j,i+1)))
                   dp[i]=Math.min(j==0?0:dp[j-1],dp[i]);
            }
            System.out.println("dp["+"i"+"]="+dp[i]);
        }
        return dp[sentence.length()-1];
    }
}

